import React from 'react';
import HeroSection from './HeroSection';
import heroImage from '../images/little-palm-hero.jpg';

function Main() {
  return (
    <main className="container">
      <HeroSection />
      <img src={heroImage} alt="Hero Image" className="hero-image" />
    </main>
  );
}

export default Main;
